import React from 'react';
import { faCommentdots, faConciergeBell, faInfoCircle } from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import './DasMenu.scss'


class DashMenu extends React.Component{
    render(){
        return(
            <div className="dashmenu-wrapper">
<button > <FontAwesomeIcon  icon={faConciergeBell}/> Menu</button>
<button ><FontAwesomeIcon icon={['fal', 'commentdots']} /> Reviews (1)</button>
<button > <FontAwesomeIcon icon={falInfoCircle}/> Restaurant Info</button>

            </div>
        )
    }
}

export default DashMenu
